from typing import List
import collections
class Solution:
    def findSubstring(self, s: str, words: List[str]) -> List[int]:
        size_word = len(words[0])
        size_permutation = size_word*len(words)
        result = []
        counter = collections.Counter(words)
        for index in range(0,len(s)):
            if check_if_consist_of_permutation(s[index:index+size_permutation],counter,words):
                result.append(index)
        return result
def check_if_consist_of_permutation(s,counter,words):
    counter_copy = counter.copy()
    size = len(words)
    size_i = len(words[0])
    if len(s) != size*size_i:
        return False
    for index in range(0,len(s),size_i):
        if s[index:index+size_i] not in counter_copy:
            return False
        counter_copy[s[index:index+size_i]] -= 1
        if counter_copy[s[index:index+size_i]] == 0:
            counter_copy.pop(s[index:index+size_i])
    if counter_copy == {}:
        return True
    else:
        return False



